import React from 'react'
import IndividualNews from './IndividualNews'

const News = (props) => {

    let listItems = props.data?.hits.map((list) => {
        return <>
            <IndividualNews
            key = {list.object} 
            name = {list.title}
            />
        </>
    })

  return listItems;
}

export default News
